import React from 'react';
import './BurgerNav.scss'
const BurgerNav = (props) => {
    console.log(props)
    return (
        <nav >
            <ul>
                <li>STRONA GŁÓWNA</li>
                <li>WESELA</li>
                <li>KOMUNIE</li>
                <li>IMPREZY OKOLICZNOŚCIOWE</li>
                <li>DEKORACJE</li>
                <li>CATERING</li>
                <li>FOTOGRAFIA</li>
                <li>KONTAKT</li>
            </ul>
        </nav>
    );
};

export default BurgerNav;
